import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Card } from "react-bootstrap";

const API_URL = "http://localhost:5009/api/company";
const CardObject = ({ objectData, companyId, identifiers }) => {
  const [objectCards, setObjectCards] = useState([]);

  useEffect(() => {
    const fetchObjectCards = async () => {
      try {
        const response = await axios.post(`${API_URL}/getObjCards`, {
          companyId,
          identifiers,
        });
        setObjectCards(response.data);
      } catch (error) {
        console.log('Ошибка при получении карточек объектов:', error);
      }
    };

    fetchObjectCards();
  }, [companyId, identifiers]);
  return (
    <Card border="primary" style={{ margin: 10}}>
      <Card.Body>
        <Card.Header>{objectData.name}</Card.Header>
        <Card.Text>
          <strong className="mb-1">Регистрационный номер: </strong> {objectData.registry_number}<br />
          <strong className="mb-1">Date Entry: </strong> {objectData.date_entry}<br />
          <strong className="mb-1">Kind Object: </strong> {objectData.kind_object}<br />
          <strong className="mb-1">Тип объекта: </strong> {objectData.type_object}<br />
          <strong className="mb-1">Адрес: </strong> {objectData.address}<br />
          <strong className="mb-1">Субъект РФ: </strong> {objectData.subject_rf}<br />
          <strong className="mb-1">Settlement: </strong>{objectData.settlement}<br />
          <strong className="mb-1">Index: </strong> {objectData.index}<br />
          <strong className="mb-1">Basis Inclusion: </strong>{objectData.basis_inclusion}<br />
          <strong className="mb-1">Date Categorization: </strong> {objectData.date_categorization}<br />
          <strong className="mb-1">Category: </strong> {objectData.category}<br />
          <strong className="mb-1">Basis Changes: </strong> {objectData.basis_changes}<br />
          <strong className="mb-1">Date Changes: </strong> {objectData.date_changes}<br />
          <strong className="mb-1">Date Changes Category: </strong> {objectData.date_changes_category}<br />
          <strong className="mb-1">Category Changes: </strong>{objectData.category_changes}<br />
          <strong className="mb-1">Basis Removal: </strong> {objectData.basis_removal}<br />
          <strong className="mb-1">Date Removal: </strong> {objectData.date_removal}<br />
        </Card.Text>
      </Card.Body>
    </Card>
  );
};

export default CardObject;
